import Image from '../../bookcover.jpg';

const Jumbo = (props) => (
    <Jumbotron className="text-center">
        <Container>
            <img className="img-fluid" src={Image} alt='cover'/>
            {/* <h1>Google Books Search</h1>
            <p>Search for and save books of interest!</p> */}
        </Container>
    </Jumbotron>
);

